import React from "react";
import refresh from "../assets/images/Group 4.png";

function Buttons() {
  return (
    <div className="main-buttons">
      <div className="btn-plus">
        <button className="btn-values">+</button>
        <button className="btn-refresh">
          <img src="refresh" alt="" />
        </button>
        <div className="bn-minus">
          <button className="btn__values-minus">-</button>
        </div>
      </div>
    </div>
  );
}

export default Buttons;
